  \"Assessment of biological diversity in the wetlands of the San Luis Valley, CO
  : A landscape-level approach [study plan]\",\n\t\"tracking_summary\": {\n\t\t\"total\":
  1,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T23:05:31.308647\",\n\t\"name\": \"assessment-of-biological-diversity-in-the-wetlands-of-the-san-luis-valley-co-a-landscape-l\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This is a pilot study designed to determine
  project feasibility and to develop baseline data, sampling techniques and determine
  appropriate sampling scales. Long-term goals of this project include developing
  1) guidelines for evaluating the impacts of wetland alteration at several spatial
  scales and 2) a wetland management plan for San Luis Valley that helps to maintain
  biodiversity, and can be used to set priorities for wetland protection, restoration
  and creation. Public lands are insufficient to protect biodiversity in the San Luis
  Valley and cooperation with private landowners will be necessary to ensure that
  a dynamic mosaic of wetland habitats are protected.\",\n\t\"license_title\": \"License
